import Apcard from "./apcard";

function Landing(){
    return(
        <div style={styles.card}>
            <Apcard
                heading="Uplinks"
                count="2/3"
                status="Healthy"
            />
            <Apcard
                heading="Switches"
                count="11/25"
                status="Healthy"
            />
        </div>
    )
}

export default Landing;

const styles = {
    card: {
    width: '300px',
    border: '1px solid #ddd',
    borderRadius: '8px',
    boxShadow: '0 2px 8px rgba(0, 0, 0, 0.29)',
    marginTop: '20px',
    backgroundColor: ' rgba(177, 253, 119, 0.58)',
    overflow: 'hidden',
    },
}
